import React from 'react';


class App extends Component {
  componentDidMount(){
    window.fetch('/users')
    .then(response => response.json())
    .then(json => console.log(json))
    .catch(error => console.log(error))
  }

  render() {
    return (
      <p>Hi</p>
    )
  }

}



export default App;
